    //   &nbsp;|&nbsp;  
    //   <NavLink to="/logout">Logout</NavLink>
    //   &nbsp;|&nbsp;  
    //   <NavLink to="/contact">Contacts</NavLink>
    //   <br></br>
    //   <hr></hr>
    // </nav>
    <AppBar position="static">
      <Toolbar>
        <IconButton 
          edge="start" 
          className={classes.menuButton} 
          color="inherit" 
          aria-label="menu"
          onClick={onMenuClick}
        >
          <MenuIcon />
        </IconButton>
        <Menu
          id="simple-menu"
          open={false}
        >
          <MenuItem onClick={alert("home clicked")}>
            <NavLink exact to="/">
              Home
            </NavLink>
          </MenuItem>
          <MenuItem onClick={alert("login clicked")}>
            <NavLink exact to="/login">
              Login
            </NavLink>
          </MenuItem>
        </Menu>
        <Typography variant="h6" className={classes.title}>
          News
        </Typography>
        <Button color="inherit">Login</Button>
      </Toolbar>
    </AppBar>
  );
}
